// frontend/src/components/MatchedImages.js
import React from "react";

const MatchedImages = ({ images }) => {
  return (
    <div>
      <h2>Matching Images</h2>
      <div style={{ display: "flex", flexWrap: "wrap" }}>
        {images.map((filename, index) => (
          <div key={index} style={{ margin: "10px", textAlign: "center" }}>
            <img
              src={`http://localhost:5000/images/${encodeURIComponent(
                filename
              )}`}
              alt={`Matching ${index}`}
              style={{ width: "150px", height: "150px", objectFit: "cover" }}
            />
            <p>{filename}</p>
            <a
              href={`http://localhost:5000/images/${encodeURIComponent(
                filename
              )}`}
              download={filename}
              style={{
                display: "inline-block",
                marginTop: "5px",
                padding: "5px 10px",
                backgroundColor: "#4CAF50",
                color: "white",
                textDecoration: "none",
                borderRadius: "5px",
              }}
            >
              Download
            </a>
          </div>
        ))}
      </div>
    </div>
  );
};

export default MatchedImages;
